from src.MDC_cut_utility import MenuIconManager
from base64 import b64encode, b64decode
from PIL import Image
import io

def png_to_base64(file_path: str) -> str:
    """
    轉換 PNG 檔案為 Base64 編碼字符串
    
    Args:
        file_path: PNG 檔案路徑
        
    Returns:
        Base64 編碼字符串
    """
    with open(file_path, 'rb') as f:
        image_data = f.read()
    return b64encode(image_data).decode('utf-8')

def base64_to_png(base64_string: str, output_path: str) -> None:
    """
    轉換 Base64 字符串為 PNG 檔案
    
    Args:
        base64_string: Base64 編碼字符串
        output_path: 輸出 PNG 檔案路徑
    """
    image_data = b64decode(base64_string)
    with open(output_path, 'wb') as f:
        f.write(image_data)
